import React, { useState } from 'react';
import axios from 'axios';

const Email = () => {
    const [emailData, setEmailData] = useState({
        to: '',
        subject: '',
        body: ''
    });

    const handleInputChange = (e) => {
        setEmailData({
            ...emailData,
            [e.target.name]: e.target.value
        });
    };

    const sendEmail = () => {
        axios.post('https://localhost:7190/api/sendEmail', emailData)
            .then(response => {
                console.log(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    };

    return (

        <>
        <form>
            <div class="form-row">
                <div class="form-group col-md-6">
                    <label for="inputEmail4">Email</label>
                    <input type="email" class="form-control" id="inputEmail4" placeholder="Email"/>
                </div>
                    <div class="form-group">
                        <label for="inputAddress">Subject</label>
                        <input type="text" class="form-control" id="inputAddress" placeholder="Subject"/>
                    </div>
            </div>
            </form>
        
        <div>
            <label>To:</label>
            <input type="text" name="to" onChange={handleInputChange} />

            <label>Subject:</label>
            <input type="text" name="subject" onChange={handleInputChange} />

            <label>Body:</label>
            <textarea name="body" onChange={handleInputChange}></textarea>

            <button onClick={sendEmail}>Send Email</button>
            </div>
        </>
    );
};

export default Email;
